const BasicHeader = () => {
    
    return(
        <header className="bg-cyan-700 p-4">
            <div className="container mx-auto flex justify-between items-center">
                <h1 className="text-white text-2xl font-bold">코노야</h1>
        <nav>
          <ul className="flex space-x-4 list-none">
            <li><a href="/" className="text-white hover:underline">Home</a></li>
            <li><a href="/about" className="text-white hover:underline">About</a></li>
            <li><a href="/services" className="text-white hover:underline">로그인</a></li>
          </ul>
        </nav>
      </div>
    </header>
    );
    
}
export default BasicHeader;
